import React from 'react';
import {Button} from 'bloomer';
// className="pa2 ma2 bg-green" variant='primary'
export const MainButton = ({ onClick }) => {
  return (
<Button className="ma1" isColor="primary" onClick={onClick}>Next</Button>
    )
}

export const Prev = ({ onClick, currentSectionIndex }) => {
	let visibility = {visibility: 'visible'}
	if (currentSectionIndex === 0) {visibility = {visibility: 'hidden'}}
  return (
<Button className="ma1" isColor="light" onClick={onClick} style={visibility}>Go Back</Button>
    )
}
